import React from "react";
import { ReactNavbar } from "react-responsive-animate-navbar";

const Navbar = () => {
  const Home = () => <h1>home</h1>;
  const Articles = () => <h1>Articles</h1>;
  const Contact = () => <h1>Contact</h1>;
  const About = () => <h1>About</h1>;

  return (
    <ReactNavbar
      color="#191919"
      menu={[        { name: "HOME", to: "/", component: Home },        { name: "ARTICLES", to: "/articles", component: Articles },        { name: "ABOUT ME", to: "/about", component: About },        { name: "CONTACT", to: "/contact" },      ]}
      social={[        {          name: "Linkedin",          url: "https://www.linkedin.com/in/nazeh-taha/",          icon: ["fab", "linkedin-in"],
        },
        {
          name: "Facebook",
          url: "https://www.facebook.com/nazeh200/",
          icon: ["fab", "facebook-f"],
        },
        {
          name: "Instagram",
          url: "https://www.instagram.com/nazeh_taha/",
          icon: ["fab", "instagram"],
        },
        {
          name: "Twitter",
          url: "http://nazehtaha.herokuapp.com/",
          icon: ["fab", "twitter"],
        },
      ]}
      sticky
    />
  );
};

export default Navbar;
